Ashoka Tree(informative post)
The ashoka is a rain-forest tree. Its original distribution was in the central areas of the Deccan plateau, as well as the middle section of the Western Ghats in the western coastal zone of the Indian subcontinent. It is a handsome, small, erect evergreen tree, with deep green leaves growing in dense clusters.
Ashoka tree is useful to manage female disorders like dysmenorrhea and menorrhagia due to its Vata balancing property. It also helps to control bleeding in piles due to its Sita (cold) property. Ashoka powder is also an effective remedy for managing worm infestation due to its Krimighna (anti-worm) property.
How to Plant Ashoka tree:
1. Ashoka tree is easily propagated by seeds.
2. Seeds can be obtained from pods in the Monsoon.
3. Seeds are sown in poly bags and seedlings are allowed to grow in semi-shade.
4. One-year-old seedlings raised in a nursery can be planted in 3 x 3 ft pits.
